in_source: |
  (defun fibonacci_sum_even (a b limit)
    (if (> b limit)
        0
        (+ (if (= 0 (mod b 2)) b 0)
           (fibonacci_sum_even b (+ a b) limit))))

  (defun euler_problem (limit)
    (fibonacci_sum_even 1 2 limit))

  (print "Sum of terms: ")
  (printi (euler_problem 4000000))
